Defined as BadEncodingFraudProof: // https://github.com/celestiaorg/celestia-specs/blob/master/specs/networking.md#badencodingfraudproof
message BadEncodingFraudProof { // height of the block with the offending row or column int64 height = 1; // the available shares in the offending row or column and their Merkle proofs // array of ShareProofs repeated ShareProof shareProofs = 2; // a Boolean indicating if it is an offending row or column; false if it is a row bool isCol = 3; // the index of the offending row or column in the square uint64 position = 4;
} name type description height Height Height of the block with the offending row or column. shareProofs ShareProof [] The available shares in the offending row or column. isCol bool A Boolean indicating if it is an offending row or column; false if it is a row. position uint64 The index of the offending row or column in the square.

