Defined as StateFraudProof: // https://github.com/celestiaorg/celestia-specs/blob/master/specs/networking.md#statefraudproof
message StateFraudProof { // height of the block with the intermediate state roots // Subtracting one from height gives the height of the block with the transactions. int64 height = 1; // shares containing the transactions and their Merkle proofs // isCol within the ShareProof must be false. // array of ShareProofs repeated ShareProof transactionShareProofs = 2; // shares containing the intermediate state roots and their Merkle proofs // isCol within the ShareProof must be false. // array of ShareProofs repeated ShareProof isrShareProofs = 3; // index for connecting the WrappedIntermediateStateRoot and WrappedTransaction after shares are parsed uint64 index = 4; // state elements that were changed by the transactions // array of StateElements repeated StateElement intermediateStateElements = 5; // sparse Merkle tree inclusion proofs for the state elements // array of SparseMerkleTreeInclusionProofs repeated SparseMerkleTreeInclusionProof stateInclusionProofs = 6;
} name type description height Height Height of the block with the intermediate state roots. Subtracting one from height gives the height of the block with the transactions. transactionShareProofs ShareProof [] isCol of type bool must be false. isrShareProofs ShareProof [] isCol of type bool must be false. index uint64 Index for connecting the WrappedIntermediateStateRoot and WrappedTransaction after shares are parsed.
